import React, { useState, useEffect } from 'react';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import axios from 'axios';

const ResumeForm = ({ onChange, onSubmit }) => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    address: '',
    objective: '',
    linkedin: '',
    github: '',
    education10th: { cgpa: '', year: '', stream: '' },
    education12th: { cgpa: '', year: '', stream: '' },
    higherQualification: { cgpa: '', year: '', stream: '' },
    skills: '',
    hobbies: '',
    achievements: '',
    certifications: '', // New field for certifications
    template: 'template1',
    photo: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith('education10th') || name.startsWith('education12th') || name.startsWith('higherQualification')) {
      const [key, field] = name.split('.');
      setFormData({ ...formData, [key]: { ...formData[key], [field]: value } });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setFormData({ ...formData, photo: file });
  };

  useEffect(() => {
    onChange(formData);
  }, [formData]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/generate-resume', formData);
      onSubmit(formData);
      generatePDF(formData);
    } catch (error) {
      console.error('Error generating resume:', error);
      generatePDF(formData); // Fallback to local generation if API fails
    }
  };

  const generatePDF = (resumeData) => {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const center = pageWidth / 2;

    doc.setFont('Helvetica', 'bold');
    doc.setFontSize(24);
    doc.text('Resume', center, 15, null, null, 'center');

    if (resumeData.photo) {
      const reader = new FileReader();
      reader.onload = function (event) {
        const image = event.target.result;
        doc.addImage(image, 'JPEG', pageWidth - 60, 10, 40, 40);
        addContent();
      };
      reader.readAsDataURL(resumeData.photo);
    } else {
      addContent();
    }

    function addContent() {
      doc.setFont('Helvetica', 'normal');
      doc.setFontSize(12);

      doc.text(`Name: ${resumeData.name}`, 10, 30);
      doc.text(`Email: ${resumeData.email}`, 10, 40);
      doc.text(`Phone: ${resumeData.phone}`, 10, 50);
      doc.text(`LinkedIn: ${resumeData.linkedin}`, 10, 60);
      doc.text(`GitHub: ${resumeData.github}`, 10, 70);
      doc.text(`Address: ${resumeData.address}`, 10, 80);

      doc.text('Objective:', 10, 100);
      doc.text(resumeData.objective, 10, 110);

      doc.autoTable({
        startY: 120,
        head: [['Level', 'CGPA', 'Year', 'Stream']],
        body: [
          ['10th Grade', resumeData.education10th.cgpa, resumeData.education10th.year, resumeData.education10th.stream],
          ['12th Grade', resumeData.education12th.cgpa, resumeData.education12th.year, resumeData.education12th.stream],
          ['Higher Qualification', resumeData.higherQualification.cgpa, resumeData.higherQualification.year, resumeData.higherQualification.stream],
        ],
        theme: 'grid',
      });

      doc.text('Skills:', 10, doc.autoTable.previous.finalY + 10);
      doc.text(resumeData.skills, 10, doc.autoTable.previous.finalY + 20);

      doc.text('Hobbies:', 10, doc.autoTable.previous.finalY + 30);
      doc.text(resumeData.hobbies, 10, doc.autoTable.previous.finalY + 40);

      doc.text('Achievements:', 10, doc.autoTable.previous.finalY + 50);
      doc.text(resumeData.achievements, 10, doc.autoTable.previous.finalY + 60);

      doc.text('Certifications:', 10, doc.autoTable.previous.finalY + 70);
      doc.text(resumeData.certifications, 10, doc.autoTable.previous.finalY + 80);

      doc.save('resume.pdf');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Existing Form Fields */}
      <textarea name="certifications" placeholder="Certifications" onChange={handleChange} required></textarea>
      <button type="submit">Generate Resume</button>
    </form>
  );
};

export default ResumeForm;
